import React from 'react';
import { Card, Divider } from 'antd';
import 'antd/dist/antd.css';
const { Meta } = Card;

function StoryCard({}){

    return (
        <Card
            style={{
                marginTop: 16,
            }}
            loading={false}
        >
            <Meta
                title="Card title"
            />
            <span className="rating">2</span>
            <Divider type="vertical" />
            <span className="author">3</span>
            <Divider type="vertical" />
            <span className="date">4</span>
        </Card>
    );
}

export default StoryCard;
